Zero Cool - vars riktiga namn ar Dade Murphy - ar en legend bland sina jamlika. 1988 kraschade han ensam 1,5O7 datorer pa Wall Street och var sedan forbjuden att anvanda en dator tills han fyllt 18. Nu har det gatt sju ar sedan han sist rorde datorn och han ar pa gang igen. Med hjalp av en van tar han sig in i det val skyddade datasystemet pa Ellingson Mineral Corporation. Omedvetet dras han in i en hogteknologisk skandal dolt av ett datavirus. Ett virus som kan forstora varldens ekosystem!



